import React, {Component} from 'react';
import './Navbar.css';
import logo from '../Assets/Logo.svg';
import Button from '../Button/Button';

class Navbar extends Component {
    render() {
        return (
            <div className='navbar'>
                <div className='nav-logo'>
                    <a href=''>
                        <img src={logo} alt='nav-logo'/>
                    </a>
                </div>
                <div className='nav-menu'>
                    <ul className='nav-list'>
                        <li><a className='nav-list-link current-page' href=''>Products</a></li>
                        <li><a className='nav-list-link' href=''>Search</a></li>
                        <li><a className='nav-list-link' href=''>Cart</a> <text>0</text></li>
                    </ul>
                    <div className='nav-login'>
                        <Button text='Login' width='100%' color='#0DB3D9'/>
                        <Button text='Register' width='100%' color='#400D37'/>
                    </div>
                </div>
            </div>
        );
    }
}

export default Navbar;
